import React, { useState, useEffect } from 'react';

const API_KEY = 'AIzaSyAXI-yLqe4jfGv-abhQBNGDVOAXTEHThIY'; // Use your actual API key here

function App() {
  const [prompt, setPrompt] = useState('');
  const [conversation, setConversation] = useState([]);

  useEffect(() => {
    // Load conversation history from localStorage on mount
    const savedConversation = localStorage.getItem('catetasConversation');
    if (savedConversation) {
      setConversation(JSON.parse(savedConversation));
    }
  }, []);

  useEffect(() => {
    // Save conversation history to localStorage on change
    localStorage.setItem('catetasConversation', JSON.stringify(conversation));
  }, [conversation]);

  const generateContent = async () => {
    if (!prompt.trim()) {
      alert('Please enter a prompt.');
      return;
    }

    // Append user prompt to conversation
    const newConversation = [...conversation, { sender: 'User', text: prompt }];
    setConversation(newConversation);

    try {
      // Call backend API to get AI response
      const response = await fetch('http://localhost:5000/generate', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ prompt }),
      });

      if (!response.ok) {
        throw new Error('Failed to get response from AI backend');
      }

      const data = await response.json();

      if (data.error) {
        throw new Error(data.error);
      }

      setConversation([...newConversation, { sender: 'AI', text: data.response }]);
      setPrompt('');
    } catch (error) {
      alert('An error occurred: ' + error.message);
    }
  };

  const clearConversation = () => {
    setConversation([]);
    localStorage.removeItem('catetasConversation');
  };

  const handleKeyDown = (e) => {
    if (e.key === 'Enter' && !e.shiftKey) {
      e.preventDefault();
      generateContent();
    }
  };

  return (
    <div style={styles.app}>
      <h1 style={styles.title}>Catetas AI</h1>
      <div style={styles.inputFrame}>
        <label style={styles.label} htmlFor="promptInput">Enter your prompt:</label>
        <textarea
          id="promptInput"
          style={styles.textarea}
          value={prompt}
          onChange={(e) => setPrompt(e.target.value)}
          onKeyDown={handleKeyDown}
          rows={5}
          placeholder="Type your prompt here..."
        />
        <div style={styles.buttonsFrame}>
          <button style={{ ...styles.button, ...styles.clearButton }} onClick={clearConversation}>
            Clear Conversation
          </button>
          <button style={{ ...styles.button, ...styles.generateButton }} onClick={generateContent}>
            Generate
          </button>
        </div>
      </div>
      <div style={styles.historyFrame}>
        <label style={styles.label}>Conversation History:</label>
        <div style={styles.historyText}>
          {conversation.length === 0 && <p style={{ color: '#7f8c8d' }}>No conversation yet.</p>}
          {conversation.map((entry, index) => (
            <p key={index} style={entry.sender === 'User' ? styles.userText : styles.aiText}>
              <strong>{entry.sender}:</strong> {entry.text}
            </p>
          ))}
        </div>
      </div>
    </div>
  );
}

const styles = {
  app: {
    backgroundColor: '#2c3e50',
    color: 'white',
    fontFamily: 'sans-serif',
    maxWidth: 750,
    margin: '20px auto',
    padding: 20,
    borderRadius: 8,
    height: '90vh',
    display: 'flex',
    flexDirection: 'column',
  },
  title: {
    fontWeight: 'bold',
    fontSize: 24,
    marginBottom: 15,
  },
  inputFrame: {
    backgroundColor: '#34495e',
    padding: 10,
    borderRadius: 6,
  },
  label: {
    fontSize: 14,
    marginBottom: 5,
    display: 'block',
  },
  textarea: {
    width: '100%',
    fontFamily: 'Consolas, monospace',
    fontSize: 14,
    padding: 8,
    borderRadius: 4,
    border: 'none',
    resize: 'vertical',
  },
  buttonsFrame: {
    marginTop: 10,
    display: 'flex',
    justifyContent: 'flex-end',
  },
  button: {
    fontSize: 14,
    fontWeight: 'bold',
    padding: '8px 16px',
    borderRadius: 4,
    border: 'none',
    cursor: 'pointer',
    marginLeft: 10,
  },
  generateButton: {
    backgroundColor: '#1abc9c',
    color: 'white',
  },
  clearButton: {
    backgroundColor: '#e74c3c',
    color: 'white',
  },
  historyFrame: {
    backgroundColor: '#34495e',
    marginTop: 20,
    padding: 10,
    borderRadius: 6,
    flexGrow: 1,
    overflowY: 'auto',
  },
  historyText: {
    backgroundColor: '#ecf0f1',
    color: '#2c3e50',
    padding: 10,
    borderRadius: 4,
    height: '100%',
    overflowY: 'auto',
    whiteSpace: 'pre-wrap',
  },
  userText: {
    marginBottom: 10,
  },
  aiText: {
    marginBottom: 10,
    fontStyle: 'italic',
  },
};

export default App;
